window.bookSummaryJSON = "<p>\"Before you embark on a journey of revenge, dig two graves...\" </p> <p>Beatrix Rose has worked her way through her Kill List. Four are dead and just two remain. But now her enemies know she has them in her sights. The hunter becomes the hunted. </p> <p>In a thrilling conclusion to the breakneck trilogy, Beatrix and her daughter must fight them in North Africa, New York and finally in the swamps of North Carolina. It's a lightning-paced roller-coaster of action that pits a deadly assassin against the might of the most powerful private army on the planet. </p> <p>It's long odds for Beatrix. And that's just how she likes it.</p>"; 
